window.bookSummaryJSON = "<p>His salvation rests in exorcising the demons of her past.</p> <p>Felix Cross is no stranger to demons. He's traveled the globe, studying under the world's most foremost demonologists and exorcists with one goal: Open a door to Hell to retrieve the soul of an innocent man.</p> <p>After he's hired to perform an exorcism on Raina Hemlock, a Kentucky senator's daughter, Felix may have found what he needs. The possessed girl claims to have been to Hell and back...literally. Now all he has to do is interrogate the demon before it destroys the girl he was hired to save.</p> <p>Yet not all is as it seems in the Hemlock household. A dark presence hovers over the house, one with a fondness for violence and blood.</p> <p>Is Raina's possession the true evil in the Hemlock house? Or is something even more sinister lurking in the mansion's forbidden rooms?</p>"; 
